import React from 'react';
import './NewAuction.scss';
import { connect } from "react-redux";
import { setLastModal } from "../../store/actions/newAuction"; //האם להציג את מודל אישור סופי
import { saveInDB } from "../../store/actions/newAuction"; //שמירת כל הנתונים במסד
const FinalStep = (props) => {
    return (
        <div id="myModal" className="modal glass" onClick={props.setLastModal(false)}>
            <div className="modal-content">
               <h1>Are you sure the Chinese auction is ready?</h1>
               <button onClick={props.saveInDB()}>Yes</button>
            </div>
        </div>);
}

export default connect(null,{setLastModal,saveInDB})(FinalStep);
